tables.table_schema:
CREATE TABLE property_performance_metrics (
   property_id INT PRIMARY KEY,
   occupancy_rate DECIMAL,
   vacancy_trend INT,
   rental_yield DECIMAL
);

CREATE TABLE property_metrics (
    property_id INT PRIMARY KEY,
    occupancy_rate FLOAT,
    vacancy_trend VARCHAR,
    rental_yield FLOAT
);

CREATE TABLE property_occupancy_metrics (
    property_id INT,
    occupancy_rate DECIMAL,
    timestamp TIMESTAMP
);

CREATE TABLE vacancy_trends (
    property_id INT,
    month DATE,
    vacancy_rate DECIMAL
);

CREATE TABLE rental_yields (
    property_id INT,
    yield_rate DECIMAL,
    timestamp TIMESTAMP
);

CREATE TABLE property_details (
    property_id INT,
    address STRING,
    rental_type STRING
);

CREATE TABLE property_occupancy (
    occupancy_id INT PRIMARY KEY,
    property_id INT,
    occupancy_date DATE,
    occupancy_percentage FLOAT
);

CREATE TABLE property_vacancy (
    vacancy_id INT PRIMARY KEY,
    property_id INT,
    vacancy_date DATE,
    vacancy_reason VARCHAR(255)
);

CREATE TABLE rental_income (
    income_id INT PRIMARY KEY,
    property_id INT,
    rent_amount FLOAT,
    payment_date DATE
);
